  name: ISymbolDocument
  nameWithType: ISymbolDocument
  fullName: System.Diagnostics.SymbolStore.ISymbolDocument
  type: Interface
  summary: "Representerar ett dokument som refererar till ett Arkiv för symbolen."
  remarks: "Ett dokument definieras av en URL och en dokumenttyp GUID. Med hjälp av dokumentet skriver GUID och URL: en, du kan hitta dokumentet. Alternativt kan du lagra dokument källa i arkivet för symbolen.       Det här gränssnittet innehåller också åtkomst till källan, om den finns.      > [!NOTE] > Det här gränssnittet är hanterade motsvarigheten till den `ISymUnmanagedDocument` gränssnitt, en ohanterad symbolen store gränssnitt som ger ett sätt att läsa och skriva felsökningsinformation för symbolen."
  syntax:
    content: >-
      [System.Runtime.InteropServices.ComVisible(true)]

      public interface ISymbolDocument
  implements: []
  platform:
  - net462
